import React from 'react';

class ReviewAudiences extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      reviews: [],
    };
  }

  componentDidMount() {
    // Simulating API call to fetch reviews
    this.fetchReviews();
  }

  fetchReviews = async () => {
    try {
      // Replace this with your actual API endpoint to fetch reviews
      const response = await fetch('https://api.example.com/reviews');
      const data = await response.json();
      this.setState({ reviews: data });
    } catch (error) {
      console.error('Error fetching reviews:', error);
    }
  };

  render() {
    const { reviews } = this.state;

    return (
      <div>
        <h2>Review Audiences</h2>
        <ul>
          {reviews.map((review) => (
            <li key={review.id}>
              <strong>Property:</strong> {review.property}<br />
              <strong>Reviewer:</strong> {review.reviewer}<br />
              <strong>Review:</strong> {review.comment}<br />
              <hr />
            </li>
          ))}
        </ul>
      </div>
    );
  }
}

export default ReviewAudiences;
